      SELECT DISTINCT + 52 * + col2 * col0 AS col1 FROM tab0 (FORMAT parquet) WHERE + + col2 NOT IN ( + 49 * - col1 * + + col1 * + col0 + - col2 / - col1 * - col1, col1, + col0 );
  - name: tab0

outputs:
  - name: q11368.out
    data: |
      36660
      45240
      499356
